def matmul_hadUt_cuda(X, hadK, K):
    return matmul_hadU_cuda(X, hadK, K, transpose=True)


def apply_exact_had_to_linear(module, had_dim=-1, output=False, R2=None, per_head=False):
    assert isinstance(module, torch.nn.Linear)
    in_features, out_features = module.in_features, module.out_features

    if had_dim != -1:
        assert is_pow2(had_dim), "Hadamard dimension must be a power of 2!"

    W_ = module.weight.data
    if module.bias is not None:
        B_ = module.bias.data
    else:
        B_ = None
    dtype = W_.dtype
    dev = W_.device
    init_shape = W_.shape
    W_ = W_.float().cuda()
    if B_ is not None:
        B_ = B_.float().cuda()

    if had_dim == -1:
        if output:
            had_K, K = get_hadK(out_features)
            W_ = matmul_hadU_cuda(W_.t(), had_K, K).t()
            if B_ is not None:
                B_ = matmul_hadU_cuda(B_.unsqueeze(0), had_K, K)[0]
        if not output:
            had_K, K = get_hadK(in_features)
            W_ = matmul_hadU_cuda(W_, had_K, K)
    else:
        hadK = hadamard_matrix(had_dim, "cuda").to(torch.float64)
        if R2 is not None:
            hadK = R2.to(torch.float64)
        if output:
            W_ = W_.t()
            transposed_shape = W_.shape
            temp = W_.reshape(-1, transposed_shape[-1] // had_dim, had_dim)
            if B_ is not None:
                bias_shape = B_.shape
                temp_bias = B_.reshape(transposed_shape[-1] // had_dim, had_dim)
            if per_head :
                num_heads = transposed_shape[-1] // had_dim
                for i in range(num_heads):
                    temp[:,i,:] = temp[:,i,:].to(torch.float64) @ hadK[i]
                    if B_ is not None:
                        temp_bias[i] = temp_bias[i].to(torch.float64) @ hadK[i]
            else:
                temp = temp.to(torch.float64) @ hadK
                if B_ is not None:
                    temp_bias = temp_bias.to(torch.float64) @ hadK
            
            W_ = temp.reshape(transposed_shape).t()
            if B_ is not None:
                B_ = temp_bias.reshape(bias_shape)
        else:
            init_shape = W_.shape
            temp = W_.reshape(-1, init_shape[-1] // had_dim, had_dim)
            if per_head :
                # will come here to merge U_value to o_proj. Need to take care of 
                num_kv_heads = hadK.shape[0] 
                num_kv_groups = init_shape[0] // (had_dim * num_kv_heads)
                for i in range(num_kv_heads):
                    for j in range(num_kv_groups):
                        idx = j + num_kv_groups * i
                        try:
                            inverse = torch.inverse(hadK[i]).t()
                        except torch._C._LinAlgError:
                            inverse = hadK[i]
                        # temp[:,idx,:] = temp[:,idx,:].to(torch.float64) @ torch.inverse(hadK[i]).t()
                        temp[:,idx,:] = temp[:,idx,:].to(torch.float64) @ inverse
            else:
                temp = temp.to(torch.float64) @ torch.inverse(hadK).t()
            W_ = temp.reshape(init_shape)
    module.weight.data = W_.to(device=dev, dtype=dtype)
    if B_ is not None:
        module.bias.data = B_.to(device=dev, dtype=dtype)


def is_pow2(n):
    return (n & (n - 1) == 0) and (n > 0)

